            styles[regionId] = 'rgb(51, 105, 30)'; // Тёмно-зелёный
          } else {
            styles[regionId] = 'rgb(124, 179, 66)'; // Светло-зелёный
          }
        } else {
          styles[regionId] = 'rgb(189, 189, 189)'; // Серый для пустых
        }
      });
      return styles;
    },
    customizePathTexts() {
      // Формируем объект текстов на основе regionItems
